import React from 'react';
import './App.css';

import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';

function App() {
    return (
        <div className="App">
            <Router>
                <header>
                    <ul>
                        <li>
                            <Link to="/login">Login</Link>
                        </li>
                        <li>
                            <Link to="/protected">Friends Home Page</Link>
                        </li>
                    </ul>
                </header>
            </Router>
        </div>
    );
}

export default App;
